string[] backpacks = input.Split(new string[] { "\r\n", "\r", "\n" }, StringSplitOptions.None);

int sum = 0;

foreach (var backpack in backpacks)
{
    int halfLength = backpack.Length / 2;
    string firstHalf = backpack.Substring(0, halfLength);
    string secondHalf = backpack.Substring(halfLength, halfLength);

    char[] firstItems = firstHalf.ToCharArray();
    char[] secondItems = secondHalf.ToCharArray();

    char duplicate = '0';
    bool found = false;
    
    for (int i = 0; i < firstItems.Length; i++)
    {
        if (found) break;
        for (int j = 0; j < secondItems.Length; j++)
        {
            if (firstItems[i] == secondItems[j])
            {
                duplicate = firstItems[i];
                found = true;
                break;
            }
        }
    }

    sum += (int)duplicate % 32; // get alphabet index
    if (char.IsUpper(duplicate))
    {
        sum += 26; //add another 26 if uppercase
    }
}

Console.WriteLine(sum);
